def postcar(path, list_of_data):
    data=list_of_data['data']
    # 用来存组合name
    file_name=[]
    # 所有数据存储地
    x=[]
    # 每一次遍历数据存储地
    cur_Data = ''
    for i in range(0,len(data)):
        #print(data[i])
        # file_name.append(data[i]['name'])
        # print(data[i]['name'])
        unit_cell = data[i]['unit_cell']
        sites = data[i]['sites']
        # 行
        row = len(unit_cell)
        # 列
        col = len(unit_cell[0])
        # 每一个数据

        # 每个组合的name
        file_name.append(data[i]['name'])
        # 加上名字
        # 第一部分数据unit_cell
        # 首先取name
        cur_Data = cur_Data + data[i]['name'] + '\n' + '1.0' + '\n'
        for i in range(row):
            for j in range(col):
                # print(unit_cell[i][j])
                # 没有无关数据，直接加
                cur_Data = cur_Data + str(unit_cell[i][j]) + ' '
            cur_Data = cur_Data + '\n'
        cur_Data = cur_Data + 'D' + '\n'
        # print(cur_Data)
        # 去除无关项
        sites = str(sites).replace("[", "").replace(",", "").replace("]", "").replace("@", "").replace("'", "")
        # 统计元素出现的个数，这种方法是每个数字都会统计
        result = {word: sites.split().count(word) for word in set(sites.split())}
        # print(result)
        # 统计元素出现次数，也就是非数字
        for key, value in result.items():
            if is_number(key):
                continue
            else:
                cur_Data = cur_Data + str(value) + " "
        cur_Data = cur_Data + "\n"
        # site数据，具有无关项，小心处理
        count = 0
        for word in (sites.split()):
            # 只要数字
            if is_number(word):
                cur_Data = cur_Data + word + " "
                count = count + 1
                # 按列输出
                if count == col:
                    cur_Data = cur_Data + '\n'
                    count = 0
        # print(cur_Data)
        x.append(cur_Data)
        # 清空当前，也就是每一个数据
        cur_Data = ''

    for i in range(0,len(x)):
        # print(file_name[i]) #str
        with open(path + str(i) + '-' + file_name[i]+'.txt', 'w') as file:
            file. write(x[i])

